RoomObject.DIRECTIONS = {
    north: [0, 0, 1],
    east: [-1, 0, 0],
    south: [0, 0, -1],
    west: [1, 0, 0],
    up: [0, 1, 0],
    down: [0, -1, 0]
}

// Maximum Number of attempts to resolve a collision before giving up.
RoomObject.maxCollisionAttempts = 10;


/**
 * Create a new RoomObject containing all necessary data to be 
 * @param {string} name name of object, must be present in ObjectManager catalog
 * @param {Object} room Room Object
 * @param {Int32Array} position x, y z definition
 */
function RoomObject(id, name, room, position) {
    this.id = id;
    this.name = name;
    this.room = room;
    this.sceneNode = scene.addNode(this.room.sceneNodes.room, objectManager.objectsCatalogue[this.name], `${this.room.id}_${this.name}`, Node.NODE_TYPE.MODEL);
    matrixHelper.matrix4.makeTranslation(this.sceneNode.transform, position);
    /** Returns position by extracting from sceneNode as it changes within the scene. */
    this.getPosition = function () {
        return matrixHelper.matrix4.getTranslation(this.sceneNode.transform);
    }
    this.setPosition = function (position, adjust = false) {
        const transform = this.sceneNode.transform;
        transform[12] = position[0];
        transform[13] = position[1];
        transform[14] = position[2];
        if (adjust) this.checkCollisionAndAdjust();
    }
    this.setScaling = function (scale, adjust = false) {
        const transform = this.sceneNode.transform;
        transform[0] *= scale[0];
        transform[5] *= scale[1];
        transform[10] *= scale[2];
        // if (adjust) this.checkCollisionAndAdjust();
    }
    this.setRotation = function (degrees, adjust = false) {
        theta = Math.radians(degrees);
        const transform = this.sceneNode.transform;
        transform[0] *= Math.cos(theta);   transform[2] *= -Math.sin(theta);  transform[5] *= 1;
        transform[8] *= Math.sin(theta);   transform[10] *= Math.cos(theta);
    }
    /** Returns a room based coordinate collider offset by current scene transform position */
    this.getCollider = function (position = null) {
        if (position !== null) { this.setPosition(position); } // Sets the position first before constructing collider
        return Collision.getOffsetObjectCollider(objectManager.objectsColliders[this.name], this.getPosition());
    }

    // Code we run upon construction - check if we're in a healthy position.
    if (!this.checkCollisionAndAdjust(0, true)) return false;

    return this;
}

/** Checks if we collide, attempts to adjust itself recursively up to maxCollisionAttempts before giving up.
 * @returns False if gave up without success.  True otherwise, setting the object's position to the adjusted value.
 */
RoomObject.prototype.checkCollisionAndAdjust = function (attempt = 0, deleteOnFail = false) {


    const ourType = ObjectManager.OBJECT_TYPES[this.name];

    /** FIRST PASS LOGIC
     * Before we waste cycles checking for collisions,
     * lets make sure we're positioned correctly depending on what we are.
     */
    if (attempt === 0) {
        const pos = this.getPosition();
        if (ourType === ObjectManager.TYPE.GROUND) {
            matrixHelper.vector3.add(pos, Collision.returnGroundAdjustment(this.getCollider(), 0), pos);
        } else if (ourType === ObjectManager.TYPE.WALL) {
            matrixHelper.vector3.add(pos, Collision.returnInitialWallAdjustment(this.getCollider(), this.room), pos);
        } else if (ourType === ObjectManager.TYPE.CEILING) {
            matrixHelper.vector3.add(pos, Collision.returnCeilingAdjustment(this.getCollider()), pos);
        } else {
            throw (`Unkown object type`);
        }

        this.setPosition(pos);
    }  // Exit condition
    else if (attempt > RoomObject.maxCollisionAttempts) {
        if (deleteOnFail) this.sceneNode.nodeObject = null;
        return false;
    }
        // If we're outside the room, we fail automatically.
    const fitsRoom = Collision.colliderFitsRoomBounds(this.getCollider(), this.room);
    if (!fitsRoom) {
        if (deleteOnFail) this.sceneNode.nodeObject = null;
        return false;
    }

    /** EXHAUSTIVE COLLISION RESOLUTION LOOP
     * We run through object list, checking for collisions after modification.
     * - Ground will shift based on stacking.
     * - Wall will shift along assigned wall.
     * - Ceiling will shift around to an open spot. */
    while (true) {
        let collidedObject = Collision.getCollisionObjectFromRoom(this.getCollider(), this.room, this.id);
        // Exit condition if no collisions found
        if (!collidedObject) return true;

        // We have a collision with object - get its overlap and try to resolve it.
        const overlap = Collision.getColliderOverlap(this.getCollider(), collidedObject.getCollider());

        // GROUND LOGIC
        if (ourType === ObjectManager.TYPE.GROUND) {
            /** If we're a ground object and we hit another ground object we must float into position */
            while (ObjectManager.OBJECT_TYPES[collidedObject.name] === ObjectManager.TYPE.GROUND) {
                // If our stack is higher, we must go above the collided object.
                if (ObjectManager.STACKING[this.name] > ObjectManager.STACKING[collidedObject.name]) {
                    const pos = this.getPosition();
                    // Set our position's ground to the the max of our lower stack colliding object.
                    matrixHelper.vector3.add(pos, Collision.returnGroundAdjustment(this.getCollider(), collidedObject.getCollider().y.max), pos);
                    this.setPosition(pos);
                } else if (ObjectManager.STACKING[this.name] < ObjectManager.STACKING[collidedObject.name]) {
                    // We found our position, but the object we're colliding against needs to resolve its position.
                    const otherPosition = collidedObject.getPosition();
                    if (!collidedObject.checkCollisionAndAdjust(attempt)) {
                        collidedObject.setPosition(otherPosition); // Reset other object
                        // Clear its collision completely and retry the loop.
                        const ourFullAdjustment = Collision.getGroundColliderAdjustmentToEscapeCollidedObject(
                            overlap, this.getCollider(), collidedObject.getCollider(), 0.05);
                        matrixHelper.vector3.add(ourFullAdjustment, this.getPosition(), ourFullAdjustment);
                        this.setPosition(ourFullAdjustment);
                        continue;
                    }
                    return true;
                } else {
                    /** We're equally stacked.  Let's try to repel each other's displacement.
                     * In addition, we'll also set each other back to the floor, and bubble back up
                     * Just in case either one of us fell off of the parent object. */
                    // Our adjustement to escape collision fully
                    const ourFullAdjustment = Collision.getGroundColliderAdjustmentToEscapeCollidedObject(
                        overlap, this.getCollider(), collidedObject.getCollider(), 0.05
                    );
                    ourFullAdjustment[1] = 0; // Set y to zero, since we don't change elevation for ground objects.
                    const ourAdjustment = matrixHelper.vector3.create();
                    matrixHelper.vector3.div(ourAdjustment, ourFullAdjustment, 2); // Split in two to result in repulsion
                    const otherAdjustment = matrixHelper.vector3.create();   // Other object's adjustment
                    matrixHelper.vector3.neg(otherAdjustment, ourAdjustment); // Inverted to move opposite of us.

                    // Move other object half distance away, back to ground and check adjustment.
                    const otherPosition = collidedObject.getPosition();
                    matrixHelper.vector3.add(otherAdjustment, collidedObject.getPosition(), otherAdjustment);
                    // otherAdjustment[1] = 0;
                    collidedObject.setPosition(otherAdjustment);

                    // Move our object half (or full) distance away from colliding object, back to ground and recheck.
                    matrixHelper.vector3.add(ourAdjustment, this.getPosition(), ourAdjustment);
                    // ourAdjustment[1] = 0;
                    this.setPosition(ourAdjustment);
                    // Let's attempt to adjust other object.
                    if (!collidedObject.checkCollisionAndAdjust(attempt)) {
                        // If we fail, set other object back to original position.
                        collidedObject.setPosition(otherPosition);
                        // User our full adjustment instead of repelling each other
                        matrixHelper.vector3.to(ourAdjustment, ourFullAdjustment);
                        // Move our object half (or full) distance away from colliding object, back to ground and recheck.
                        matrixHelper.vector3.add(ourAdjustment, this.getPosition(), ourAdjustment);
                        this.setPosition(ourAdjustment);
                        matrixHelper.vector3.add(ourAdjustment, Collision.returnGroundAdjustment(this.getCollider(), 0), ourAdjustment);
                        this.setPosition(ourAdjustment);
                    }

                    return this.checkCollisionAndAdjust(attempt + 1, deleteOnFail);
                }

                // Try to get another stack related  collision.
                collidedObject = Collision.getCollisionObjectFromRoom(this.getCollider(), this.room);

                // If we're no longer colliding, our job is done.
                if (!collidedObject)
                    return true;

                // If we're still colliding, the next loop will use the updated collision object to determine action.
            }

            // We're a ground object, and still colliding but no longer with another ground object.  Let's give up and throw an error.
            if (deleteOnFail) {
                this.sceneNode.nodeObject = null;
            }
            return false;
        } // End of ground logic

        // When we're a wall, we just give up.
        // else if (ourType === ObjectManager.TYPE.WALL || ourType === ObjectManager.TYPE.CEILING) {
        this.sceneNode.nodeObject = null;
        return false;
        //}


    } /** EXHAUSTIVE COLLISION RESOLUTION LOOP */
}

