/** Returns an objects catalogue dictionary 
 * @returns {Dictionary} in the form of { objectName: Model }
 */
ObjectManager.prototype.getObjectCatalogue = function () {
    return Object.keys(this.objectsCatalogue);
}

ObjectManager.prototype.getObjectCollider = function (objName) {
    return this.objectsColliders[objName];
}

ObjectManager.prototype.buildObjectsColliders = function () {
    const result = {};
    for (const objectName in this.objectsCatalogue) {
        const objectModel = this.objectsCatalogue[objectName];
        result[objectName] = Collision.getLocalObjectColliderBounds(objectModel);
    }

    return result;
}

/** Construct model to be bound to scene node */
ObjectManager.prototype.buildModelsDictionary = function () {
    const result = {};
    for (const jsonFileKey in ObjectManager.JSON_DATA) {
        const jsonData = ObjectManager.JSON_DATA[jsonFileKey];

        const modelData = waveFrontObjToVertexIndexLists(jsonData);

        const newModel = new Model();
        newModel.name = jsonFileKey;
        newModel.index = modelData.index;
        newModel.vertex = modelData.vertex;
        newModel.compile(scene);
        newModel.material = buildBasicMaterial("redCloth");
        result[jsonFileKey] = newModel;
    }
    return result;
}

/** Wavefront OBJ files converted to JSON using reference:
 * http://www.kurilo.su/workingprocess/webgl/c/
 * 
 * Alternative is also available in CPP format as a converter.
 * Both appear to work fine.  Website is more convenient.
 * 
 * Output from site is [verts, normals, texcoords, indices]
 */
function waveFrontObjToVertexIndexLists(waveObjJSON) {
    const vertexList = [], indexList = [];
    for (var i = 0; i < waveObjJSON.verts.length / 3; i++) {
        // Push 3 vertex coordinates (triangle), normals, colors and uvs
        vertexList.push(Number(waveObjJSON.verts[i * 3]));          // x vert
        vertexList.push(Number(waveObjJSON.verts[i * 3 + 1]));      // y vert
        vertexList.push(Number(waveObjJSON.verts[i * 3 + 2]));      // z vertv
        vertexList.push(Number(waveObjJSON.normals[i * 3]));        // x norm
        vertexList.push(Number(waveObjJSON.normals[i * 3 + 1]));    // y norm
        vertexList.push(Number(waveObjJSON.normals[i * 3 + 2]));    // z norm
        vertexList.push(0);                                 // x color
        vertexList.push(0);                                 // y color
        vertexList.push(0);                                 // z color -- No tint
        vertexList.push(Number(waveObjJSON.texcoords[i * 2]));      // UV
        vertexList.push(Number(waveObjJSON.texcoords[i * 2 + 1]));  // UV
    }

    return { vertex: vertexList, index: waveObjJSON.indices };
}